import React from 'react';
import styled from 'styled-components'
// gives a the google font 'Montserrat', you can check more fonts at google fonts
const A = styled.a ` 

    font-family: 'Montserrat', sans-serif;

`

const Headwrapper = styled.header `
    display: relative;
    background: #2A2F36;
    margin: -8px;
    padding: 10px;
    color: #ffffff;
    .logo {
        position: absolute;
        /* top: 50%; left:15px; */ 
        color: #ffffff;
        transform: translateY(50%); 
        transform: translateX(100%);


    }

    nav {

        color: #ffffff;
        ul li {
            list-style-type: none;
            display: inline-block;
            margin-right: 10px;

    }
        a {
            color: #ffffff;
            font-family: 'Montserrat', sans-serif;

        }


}
`

const Div = styled.div`
    margin: 0px;

`
function Header() {
  return (
        <Headwrapper> 

            <div className = "logo">
                LOGO
            </div>

            <nav>
                <ul>
                    <li className = "first">
                        <a href = "#">Hem</a>
                    </li>
                    <li className = "last">
                        <a href = "#">Meny</a>
                    </li>
                </ul>
            </nav>

        </Headwrapper>
  );
}

export default Header;
